/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `request_AUP` AFTER UPDATE ON `request` FOR EACH ROW BEGIN
	IF NEW.r_status <> OLD.r_status and NEW.r_status = 'Granted' THEN
	set @bloodtype = (SELECT 
		idbloodtype
	FROM
		request
	WHERE
		idrequest = NEW.idrequest);
        
	set @quantity_request = (SELECT 
		r_quantityrequest
	FROM
		request
	WHERE
		idrequest = NEW.idrequest);
        
	UPDATE inventory 
	SET 
		number_of_request_granted = (number_of_request_granted + @quantity_request)
	WHERE
		idinventory = @bloodtype;
        
    END IF;
END */;;
